import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Nav_Top from "src/Nav_Top";
import Main from 'src/Main';
import Header from "src/Header";
import AboutUS from 'src/AboutUS'


const App = () => (
    <Router>
        <div className="App">
            <Nav_Top />
            <Route exact path='/' componunt={Main}/>
            <Route path ="src/Header" compomunt={Header}/>
            <Route path ='src/AboutUS' compomunt={AboutUS}/>
        </div>
    </Router>
);




export default App;
